if any of you finish the pre work and want to be more prepared for the topics in this course which tend to trip students up :

<https://www.khanacademy.org/math/statistics-probability> - lots of useful components on this course- highly recommended self paced learning to prepare anyone who is not completely confident with applying statistics

<https://guides.github.com/activities/hello-world/> we will be using github for collaborative projects but also day to day, to share resources and for you to store and submit your labwork. you will see examples of such steps on this <https://www.youtube.com/watch?v=fqlk8ib_skk|youtube video>. learning the basics of how to use github will make your bootcamp life easier, plus i can recommend installing a visual front end tool for github called <https://www.gitkraken.com/git-client|gitkraken> (make sure your repository is public!)

hello andrea! it is common to have problems in the connection in the begging. recheck your credentials and check that the password that you entered does not contain the &lt;&gt; characters that are indicated in the prework part.

if sequel pro keeps giving you problems, you can try to use mysql workbench. in general it is easier to connect.

if not, we can have a talk to fix the problem (tomorrow or during the first week), don’t worry :slightly_smiling_face:

def combo(x, y):
    if np.isnan(x) and np.isnan(y):
        return x + '-' + y
    elif np.isnan(x):
        return y
    elif np.isnan(y):
        return x

